drop table if exists purchase;
drop table if exists store;
drop table if exists customer;
drop table if exists item;

create table store (
    id SERIAL,
    name text,
    street text,
    city text,
    state text,
    country text,
    post_code int,
    latitude float,
    longitude float,
    primary key (id)
);

create table customer (
    id SERIAL,
    first_name text,
    last_name text,
    email text,
    lifetime_value int,
    primary key (id)
);

create table item (
    id SERIAL,
    name text,
    description text,
    price int,
    cost int,
    primary key (id)
);

create table purchase (
    id SERIAL,
    store_id int,
    item_id int,
    customer_id int,
    total_quantity int, 
    price int,
    order_placed timestamp,
    order_collected timestamp,
    primary key (id),
    constraint customer_fk foreign key(customer_id) references customer(id),
    constraint store_fk foreign key(store_id) references store(id),
    constraint item_fk foreign key(item_id) references item(id)
);

BEGIN;






COMMIT;